import React from "react";
import "./Fact.css";

const Fact = (props) => {
  return (
      <article>
      <h1>
        {props.numberToDisplay + ' '}
        {props.topicToDisplay + ' '} </h1>
      <div >
      <p className>{props.factToDisplay}</p>
    </div>
    </article>
  );
}
export default Fact;
